function run(inputVariable1) {
    const repositories = JSON.parse(inputVariable1);
    const events = [];

    repositories.data.forEach(repo => {
        events.push({
            "header": {
                "type": "application/vnd.lime.media-link+json",
                "value": {
                    "title": repo.name,
                    "text": repo.description,
                    "type": "image/jpeg",
                    "uri": repo.imagem,
                    "aspectRatio": "1:1"
                }
            }
        });
    });

    return {
        "itemType": "application/vnd.lime.document-select+json",
        "items": events
    };
}
